static unsigned int seed;
static void seeding(unsigned int x, unsigned int y, unsigned int z) 
//{ seed=x%unsigned int(1024)+(y%unsigned int(1024))*unsigned int(1024)+(z%unsigned int(1024))*unsigned int(1024*1024); }
{ seed=phi(x+phi(y+phi(z)))%(unsigned int)(1<<15)+(phi(3*x+phi(4*y+phi(z)))%(unsigned int)(1<<15))*(unsigned int)(1<<15); }
static float next() { seed *= (unsigned int)(3039177861); float res=(float)((double(seed)/4294967296.0)*2.0-1.0); return res; }

static float BesselISimple(float x)
{
	float y = x*0.5f;
	float  y2 = y*y;
	return y2*y*(1.0f / 6.0f + y2*(1.0f / 24.0f + y2*(1.0f / 240.0f + y2*(1.0f / 4320.0f + y2 / 120960.0f))));
}

static float Kaiser(float x)
{
	float PI = 3.1415926535897932384626433832795f;
	float i = x; if (i>1.0f) i = 1.0f; if (i<0.0f) i = 0.0f;
	return BesselISimple(PI*3.0f*(float)sqrt(1.0f - i)) / BesselISimple(PI*3.0f);
}



static float mcnoise2D(float x, float y, float freq, int ncos, float scal) 
// scal is spatial size of Gaussian, must be between 1.0 and 128.0 (1.0 means one pixel of an image of res 256x256)
// corresponding spectral Gaussian is 128.0/scal pixels wide for a discrete domain of size 256x256
{
	int i,j,k;
	float v=0.0;

	x /= scal; y/= scal; freq*=scal;
	int ix = (int)floor(x); float xx = x-(float)ix;
	int iy = (int)floor(y); float yy = y-(float)iy;
	for (i=-1; i<=1; i++)
	for (j=-1; j<=1; j++)
	{
		float ivpx=(float)ix+(float)i;
		float ivpy=(float)iy+(float)j;
		seeding((unsigned int)(ivpx), (unsigned int)(ivpy), 0);
		float cx = xx-(float)i - 0.5f;// - 5.0f*next()/(scal+8.0f);
		float cy = yy-(float)j - 0.5f;// - 5.0f*next()/(scal+8.0f);
		float dd=(float)(cx*cx+cy*cy);
		float sumcos=0.0f;
		for (k=0; k<ncos; k++)
		{
				//float stripe = -3.141593f*0.5f+3.141593f*(float)k / (float)ncos + 0.25f*3.141593f*(next() + 1.0)*0.125f / (float)ncos;
				float stripe = -3.141593f*0.5f + 3.141593f*(float)k / (float)ncos + 3.141593f*(next() + 1.0)*0.5f / (float)ncos;
				float ff = 2.0f*3.141593f*freq*(cx*cos(stripe) + cy*sin(stripe))*(0.8 + 0.1*(next() + 1.0));
				sumcos += (float)cos(ff + 3.141593f*next());
		}
		v += (float)exp(-dd*2.0)*sumcos;
		//v += (float)exp(-dd*128.0);
	}
	return v/(float)ncos;
	//return v*2.0-1.0;
}
