static float mcnoise2D(float x, float y, float freqx[], float freqy[], float freqdx[], float freqdy[], float amp[], int ncos, float scal, bool jitter=false) 
// scal is spatial size of Gaussian, must be between 1.0 and 128.0 (1.0 means one pixel of an image of res 256x256)
// corresponding spectral Gaussian is 128.0/scal pixels wide for a discrete domain of size 256x256
{
	int i,j,k;
	float v=0.0;

	x /= scal; y/= scal;
	int ix = (int)floor(x); float xx = x-(float)ix;
	int iy = (int)floor(y); float yy = y-(float)iy;
	for (i=-1; i<=+1; i++)
	for (j=-1; j<=+1; j++)
	{
		float ivpx=(float)ix+(float)i;
		float ivpy=(float)iy+(float)j;
		seeding((unsigned int)(ivpx), (unsigned int)(ivpy), 0);
		float cx = xx-(float)i - 0.5f - 4.0f*next()/(scal+6.0f);
		float cy = yy-(float)j - 0.5f - 4.0f*next()/(scal+6.0f);
		float dd=(float)(cx*cx+cy*cy);
		float sumcos=0.0f;
		for (k=0; k<ncos; k++)
		{
			float ff= 2.0f*3.141593f*scal*(cx*(freqx[k]+(0.5*(next()+1.0))*freqdx[k])+cy*(freqy[k]+(0.5*(next()+1.0))*freqdy[k]));
			sumcos += amp[k]*(float)cos(ff+3.141593f*next());
		}
		if (!jitter) v += (float)exp(-dd*2.0)*sumcos;
		else v += (float)exp(-dd*500.0);
	}
	if (!jitter) return v;
	else return v*2.0-1.0;
}

static float mcnoise2Dlist(float x, float y, float *freqx[], float *freqy[], float *amp[], float *phase[], int ncos, int nfreq, float scal, bool jitter=false) 
// scal is spatial size of Gaussian, must be between 1.0 and 128.0 (1.0 means one pixel of an image of res 256x256)
// corresponding spectral Gaussian is 128.0/scal pixels wide for a discrete domain of size 256x256
{
	int i,j,k;
	float v=0.0;

	x /= scal; y/= scal;
	int ix = (int)floor(x); float xx = x-(float)ix;
	int iy = (int)floor(y); float yy = y-(float)iy;
	for (i=-1; i<=+1; i++)
	for (j=-1; j<=+1; j++)
	{
		float ivpx=(float)ix+(float)i;
		float ivpy=(float)iy+(float)j;
		seeding((unsigned int)(ivpx), (unsigned int)(ivpy), 0);
		float cx = xx-(float)i - 0.5f - 4.0f*next()/(scal+6.0f);
		float cy = yy-(float)j - 0.5f - 4.0f*next()/(scal+6.0f);
		float dd=(float)(cx*cx+cy*cy);
		float sumcos=0.0f;
		for (k=0; k<ncos; k++)
		{
			int choice = int(0.5*(next()+1.0)*(float)nfreq); if (choice>=nfreq) choice=nfreq-1;
			float ff= 2.0f*3.141593f*scal*(cx*freqx[k][choice]+cy*freqy[k][choice]);
			//float aa = 0.5f+1.5f*0.5f*(next()+1.0f);
			sumcos += (1.0+0.5*next())*amp[k][choice]*(float)cos(ff+3.141593f*next());
		}
		if (!jitter) v += (float)exp(-dd*2.0)*sumcos;
		else v += (float)exp(-dd*500.0);
	}
	if (!jitter) return v;
	else return v*2.0-1.0;
}

