		//float sumcos=(float)pp[kx+int(cx*scal*ratio)+ sx*(ky+int(cy*scal*ratio))];
		int indx=kx+int(cx*scal*ratio); while(indx<0) indx+=sx; if (indx>=sx) indx %= sx;
