static float sinc(float x)
{
	if (x==0.0f) return 1.0f; else if (x<-8.0 || x>8.0) return 0.0;
	return (float)sin(M_PI*x)/M_PI/x;
}
static float boxnoise2D(float x, float y, float freq, float stripe, bool kerneltype=true)
{
	 int i,j,k;
	 float v=0.0;
	 float ss=3.0; // kernel size for sinc

	int ix = (int)floor(x); float xx = x-(float)ix;
	int iy = (int)floor(y); float yy = y-(float)iy;
	for (i=-1; i<=+1; i++)
	for (j=-1; j<=+1; j++)
	{
		float ivpx=(float)ix+(float)i;
		float ivpy=(float)iy+(float)j;
		seeding((unsigned int)(ivpx), (unsigned int)(ivpy), 0);
		int nk = 8+(int)(8.0*(next()+1.0));
		for (k=0; k<nk; k++) // number of kernels in one cell is in [8,16]
		{
		float cx = xx-(float)i - 0.5f - 0.5f*next();
		float cy = yy-(float)j - 0.5f - 0.5f*next();
		float fr = 0.5+0.25*(next()+1.0);
		float dd= (float)sqrt(cx*cx+cy*cy);
		float ff = 2.0f*3.14159265358979f*freq*(cx*cos(stripe)+cy*sin(stripe));
		//if (kerneltype) v += fr*exp(-dd*dd*1.5f)*sinc(ss*cx)*sinc(ss*cy)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		if (kerneltype) v += fr*sinc(ss*cx)*sinc(ss*cy)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		else v += fr*exp(-dd*dd*15.0f)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		}
	}
	if (kerneltype) v /= 6.0f; else v /= 8.0f;
	if (v<-0.999f) v=-0.999f; else if (v>0.999f) v=0.999f;
	return v;
}

