static float boxnoise3D(float x, float y, float z, float freq, float stripe, float theta=0.0f, bool kerneltype=true)
{
	 int i,j,k,m;
	 float v=0.0;
	 float ss=3.0; // kernel size for sinc

	int ix = (int)floor(x); float xx = x-(float)ix;
	int iy = (int)floor(y); float yy = y-(float)iy;
	int iz = (int)floor(z); float zz = z-(float)iz;
	for (i=-1; i<=+1; i++)
	for (j=-1; j<=+1; j++)
	for (m=-1; m<=+1; m++)
	{
		float ivpx=(float)ix+(float)i;
		float ivpy=(float)iy+(float)j;
		float ivpz=(float)iz+(float)m;
		seeding((unsigned int)(ivpx), (unsigned int)(ivpy), (unsigned int)(ivpz));
		int nk = 8+(int)(8.0*(next()+1.0));
		for (k=0; k<nk; k++) // number of kernels in one cell is in [8,16]
		{
		float cx = xx-(float)i - 0.5f - 0.5f*next();
		float cy = yy-(float)j - 0.5f - 0.5f*next();
		float cz = zz-(float)m - 0.5f - 0.5f*next();
		float fr = 0.5+0.25*(next()+1.0);
		float dd= (float)sqrt(cx*cx+cy*cy+cz*cz);
		float ff = 2.0f*3.14159265358979f*freq*(cx*cos(stripe)*cos(theta)+cy*sin(stripe)*cos(theta)+cz*sin(theta));
		if (kerneltype) v += fr*sinc(ss*cx)*sinc(ss*cy)*sinc(ss*cz)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		else v += fr*exp(-dd*dd*15.0f)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		//v += fr*exp(-dd*dd*1.5f)*sinc(ss*cx)*sinc(ss*cy)*sinc(ss*cz)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
		}
	}
	if (kerneltype) v /= 4.0f; else v /= 6.0f;
	if (v<-0.999f) v=-0.999f; else if (v>0.999f) v=0.999f;
	return v;
}

