static float boxnoise2Disotropic(float x, float y, float freq, bool kerneltype=true)
{
	 int i,j,k, ll;
	 float v=0.0;
	 float ss=3.0; // kernel size for sinc

	for (ll=0; ll<5; ll++)
	{
		double alpha = 0.5f*3.14159265358979f*(-1.0f+2.0f*((float)ll)/(float)5.0);
		float tx = x*cos(alpha)-y*sin(alpha);
		float ty = x*sin(alpha)+y*cos(alpha);
		int ix = (int)floor(tx); float xx = tx-(float)ix;
		int iy = (int)floor(ty); float yy = ty-(float)iy;
		for (i=-1; i<=+1; i++)
		for (j=-1; j<=+1; j++)
		{
			float ivpx=(float)ix+(float)i;
			float ivpy=(float)iy+(float)j;
			seeding((unsigned int)(ivpx), (unsigned int)(ivpy), ll);
			int nk = 6+(int)(5.0*(next()+1.0));
			for (k=0; k<nk; k++) // number of kernels in one cell is in [50,70]
			{
				float cx = xx-(float)i - 0.5f - 0.5f*next();
				float cy = yy-(float)j - 0.5f - 0.5f*next();
				float fr = 0.5+0.25*(next()+1.0);
				float dd= (float)sqrt(cx*cx+cy*cy);
				float stripe = 0.5f*3.14159265358979f/5.0*next();
				float ff = 2.0f*3.14159265358979f*freq*(cx*cos(stripe)+cy*sin(stripe));
				//if (kerneltype) v += fr*(float)exp(-dd*dd*0.5f)*sinc(cx*ss)*sinc(cy*ss)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
				if (kerneltype) v += fr*sinc(cx*ss)*sinc(cy*ss)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
				else v += fr*(float)exp(-dd*dd*25.0f)*(float)cos(ff+(next()<0.0?3.14159265358979f:0.0f));
			}
		}
	}
	if (kerneltype) v /= 10.0f; else v /= 12.0f;
	if (v<-0.999f) v=-0.999f; else if (v>0.999f) v=0.999f;
	return v;

}

